class Solution(object):
    def findLatestStep(self, arr, m):
        """
        :type arr: List[int]
        :type m: int
        :rtype: int
        """
        def check_exist(bits, m):
            
            grp = 0
     
            for bit in bits:
                if(bit == 0):
                    if(grp == m):
                        return   True
                    grp = 0
                    continue
                grp += 1
                
            if(grp == m):
                return True
            return  False
                
                
        bits = [0]* len(arr)
        last_step = -1
        step = 1
        for i in range(len(arr)):
            index = arr[i]-1
            bits[index] = 1
            is_exist = check_exist(bits, m)
            if(is_exist):
                last_step = step
            step += 1
        return last_step
            
            
            
